import React, { useState, useEffect } from 'react';
import { Outlet } from 'react-router-dom';
import Navbar from './Navbar';
const url = 'https://burgers-hub.p.rapidapi.com/burgers';
const key = {
  method: 'GET',
  headers: {
    'X-RapidAPI-Key': 'cd74d7a9f4msh293742f79e45a49p1693e6jsn81ac83069ac5',
    'X-RapidAPI-Host': 'burgers-hub.p.rapidapi.com',
  },
};

function Home() {
  const [data, setData] = useState('');
  const [count, setCount] = useState(0);

  const request = () => setCount((prev) => prev + 1);

  useEffect(() => {
    fetch(url, key)
      .then((res) => res.json())
      .then((intel) => setData(intel))
      .catch((error) => console.log(`your error: ${(<br />)} ${error}`));
  }, [count]);

  console.log(data);
  const msg = data.message;

  return (
    <div>
      <Navbar />
      <h1>hello</h1>
      <h3>{msg}</h3>
      <button onClick={request}>requests {count}</button>
      <Outlet context={{ data, setData }} />
    </div>
  );
}

export default Home;
